###
# 给你一个下标从 0 开始的 m x n 整数矩阵 grid 和一个整数 k 。你从起点 (0, 0) 出发，每一步只能往 下 或者往 右 ，你想要到达终点 (m - 1, n - 1) 。
# 请你返回路径和能被 k 整除的路径数目，由于答案可能很大，返回答案对 10^9 + 7 取余 的结果。
#
# 记忆化搜索，直接用@cache会导致超内存，改成了自己做记忆化搜索。
class Solution:
    def numberOfPaths(self, grid: List[List[int]], k: int) -> int:
        # 增加递归深度限制以处理大型网格
        sys.setrecursionlimit(100000)
        
        MOD = 1_000_000_007
        m, n = len(grid), len(grid[0])
        memo = [[dict[int, int]() for _ in range(n)] for _ in range(m)]

        def dfs(i, j, target):
            if target in memo[i][j]:
                return memo[i][j][target]
            if i == 0 and j == 0:
                return 1 if grid[i][j] % k == target else 0
            res = 0
            if i > 0:
                res += dfs(i - 1, j, (target - grid[i][j]) % k)
            if j > 0:
                res += dfs(i, j - 1, (target - grid[i][j]) % k)
            # print(f"i:{i}, j:{j}, target:{target}, res:{res}")
            memo[i][j][target] = res % MOD
            return memo[i][j][target]

        return dfs(m - 1, n - 1, 0)

